webpackJsonp([0xf041ef121012],{3728:function(t,a){t.exports={data:{markdownRemark:{html:'<p>お待たせしました、<a href="/category/products/apps">Win32ゲーム</a>コーナー追加。</p>\n<h2>本日の駄文</h2>\n<p>家の前のスーパーで買い物中、営業時間中なのに突如閉店。自分もかごの中を全て回収されて追放。理由は『レジが壊れた』だそうだ。  そこいらの小さな八百屋がそれなら仕方ないかも知れんが、それなりにいっちょ前の規模を持つスーパーが『レジが壊れた』で閉店は勘弁してほしい。……イナカって、こんなものなのだろうか。</p>',frontmatter:{cover:null,date:"2004-08-20T00:00:00+09:00",strDate:"2004/8/19",title:"コンテンツ追加"}}},pathContext:{path:"/ja/blog/2004/08/20-コンテンツ追加-4/",langKey:"ja"}}}});
